import React from 'react';
import { Card, Button, Container } from 'react-bootstrap';
import { useNavigate } from 'react-router-dom';

const AdminHome = () => {
  const navigate = useNavigate();

  return (
    <Container className="mt-5 text-center">
      <h2 className="mb-4">üë®‚Äçüíº Admin Dashboard</h2>
      <Card className="p-4 shadow-sm">
        <Button className="m-2" onClick={() => navigate('/admin/users')} variant="info">View Users</Button>
        <Button className="m-2" onClick={() => navigate('/admin/agents')} variant="warning">Manage Agents</Button>
        <Button className="m-2" onClick={() => navigate('/admin/panel')} variant="dark">Admin Panel</Button>
      </Card>
    </Container>
  );
};

export default AdminHome;
